class InstallTest {
    constructor() {
        let win = new Window(400, 300, "App Store Install Test",25,25, 5,2.2);
        this.window = win.getWindow();
        this.header = win.getHeader();
        this.win = win;

        var p = document.createElement("p");
        p.innerText = "Hello App Store Installer!";
        this.window.appendChild(p);
    }
}
function makeInstallTest() {
    new InstallTest;
}
appImagePaths["InstallTest"] = "data:image/png;base64,";
makeFunctions["InstallTest"] = ()=>{ makeInstallTest(); };
